import React from 'react';
import {MDBBtn, MDBInput} from "mdb-react-ui-kit";

const Filter = () => {
    return (
        <>
            <h3>Search</h3>
            <div className="d-flex justify-content-center align-items-center mb-4">
                <MDBInput
                    type="text"
                    id="form1"
                    label="Search task..."
                    wrapperClass="flex-fill"
                />
            </div>
            <hr></hr>
        </>
    );
};

export default Filter;
